from sympy import flatten
def ok(n, L):
    return any(i < n for i in L)
def a(n):
    if n==1: return 1
    L=[n]
    while not ok(n, L):
        L=set(flatten([[3*k + 1, k//2] if k%2==0 else 3*k + 1 for k in L]))
    return len(L)
print([a(n) for n in range(1, 121)]) # _Indranil Ghosh_, Aug 22 2017

